fill_tpcc_map(){
    tpcc_tests["cleanup_prepare_tpcc"]="sysbench /opt/tools/sysbench-tpcc/tpcc.lua --mysql-host=${host} --mysql-port=${port}  --mysql-user=${USER} --mysql-password=${PW} --mysql-db=${schemaname} --db-driver=mysql --tables=${TPCc_TABLES} --scale=${WHAREHOUSES} --report-interval=1 --mysql-ignore-errors=all --histogram --report_csv=yes  --stats_format=csv --db-ps-mode=disable "
    tpcc_tests["run_tpcc_RepeatableRead"]="sysbench /opt/tools/sysbench-tpcc/tpcc.lua --mysql-host=${host} --mysql-port=${port}  --mysql-user=${USER} --mysql-password=${PW} --mysql-db=${schemaname} --db-driver=mysql --tables=${TPCc_TABLES} --scale=${WHAREHOUSES} --rand-type=uniform --report-interval=1 --mysql-ignore-errors=all --histogram --report_csv=yes  --stats_format=csv --db-ps-mode=disable --trx_level=RR --enable_purge=yes "
    tpcc_tests["run_tpcc_ReadCommitted"]="sysbench /opt/tools/sysbench-tpcc/tpcc.lua --mysql-host=${host} --mysql-port=${port}  --mysql-user=${USER} --mysql-password=${PW} --mysql-db=${schemaname} --db-driver=mysql --tables=${TPCc_TABLES} --scale=${WHAREHOUSES} --rand-type=uniform --report-interval=1 --mysql-ignore-errors=all --histogram --report_csv=yes  --stats_format=csv --db-ps-mode=disable --trx_level=RC --enable_purge=yes "
}